  JSHERRIFF, John Richard and WINCHCOMBE, Ngaire Frances
  SHERRIFF, John Richard and WINCHCOMBE, Ngaire Frances (cont...)
  Eastern Bay of Plenty Manager for the Kiwifruit Marketing Board.
  01> SHERRIFF, Craig William
  b 13.09.1976
  Craig b. at Sydney, Australia. He completed five years secondary education at Hamilton Boys'
  High School,
  02> SHERRIFF, Danielle Frances
  b 15.03.1978
  Danielle b. at Sydney, Australia. She completed four years secondary education at Hamilton
  Girls' High School then spent a year in Chile as an AFS International Exchange Student. She is
  now completing her third year of a Diploma of Tourism at Waikato Polytechnic and during the
  course she was successful in gaining a tourism education exchange to Singapore.
  03> SHERRIFF, Megan Frances
  b 17.11.1980
  Megan b. at Whakatane. She completed four years secondary education at Hamilton Girls' High
  School where she represented the school at rowing. She is presently on a year-long AFS
  Intercultural Exchange in Argentina.
  04> SHERRIFF, Laurence Patrick m on 28.09.1967 to TULLOCH, Jessie Mary
  (Paddy)
  b 08.04.1945 d 21.07.1984
  b 06.12.1946
  Paddy b. at Gisborne and m. at Otorohanga and d. at Masterton. Mary, d/o Alan Espie Tulloch and
  Mary Isobel Anne McNeil, b. at Gisborne. Address: (Mary) Glenmoa, 10c RD, Oamaru.
  Paddy was educated at Gisborne Boys' High School (1958-63). He worked as a shepherd on "Huiarua"
  station (1964-66); married shepherd on "Rototahi" station, Tolaga Bay (1967-69); managed "Kahuiti"
  station, Masterton (1970-75) and managed "Waikohi" station, Masterton (1975-82). He bought his own
  farm, "Tarohiwi", at Mount Bruce, Masterton in 1982. Paddy played rugby for the East Coast in 1968
  and was a member of the Wairarapa A Polo team for two years.
  Mary was educated at Otorohanga then trained and worked as a beauty consultant. After Paddy's
  death she married John Foley whose wife, Anne Myra McLennon had died in 1985. John and Annie had a
  daughter, Ginny Anne Foley born in 1984.
  01> SHERRIFF, Kirsty Jane
  b 03.03.1971
  Kirsty b. at Masterton. She attended primary school in Masterton then went to St Matthew's
  College, Masterton for five years before training as a nurse at Wellington Polytechnic. She
  nursed at Gisborne Hospital in 1993-95 and at Burwood Spinal Unit, Christchurch in 1995-97.
  She is presently overseas.
  02> SHERRIFF, Alan Samuel
  b 14.06.1972
  Samuel 6. at Masterton. He attended primary school in Masterton then went to Rathkeale College
  in Masterton for four years. He was then farming until travelling overseas,
